#import "ViewController.h"

@interface ViewController ()

@end

@implementation ViewController

- (void)viewDidLoad {
    [super viewDidLoad];
    // Do any additional setup after loading the view, typically from a nib.
    
    
    /*
    NSString* jsonStr = @"{\"image\": ,\"date\": 2015年11月28日 07時05分}";
     */
    
    AFHTTPRequestOperationManager* manager = [AFHTTPRequestOperationManager manager];
    [manager GET:@"http://hoge/sample.json"
      parameters:nil success:^(AFHTTPRequestOperation *operation, id responseObject) {
          NSLog(@"response: %@", responseObject);
      } failure:^(AFHTTPRequestOperation *operation, NSError *error) {
          NSLog(@"Error: %@", error);
      }];
    
    
    NSArray *strings1 = [_jsonStr componentsSeparatedByString:@","];
    
    NSMutableArray *strArray = [[NSMutableArray alloc] init];
    
    for (int i =0; i < strings1.count ; i++) {
        NSArray *strings2 = [strings1[i] componentsSeparatedByString:@":"];
        [strArray addObject:strings2];
    }
    // strArray[0][1] : jpgStr
    // strArray[1][1] : date

    NSString *jpgStr = strArray[0][1];
    NSString *date = strArray[1][1];
    
    NSData *jpgData = [[NSData alloc] initWithBase64EncodedString:jpgStr
                                                          options:NSDataBase64DecodingIgnoreUnknownCharacters];
    UIImage* image = [UIImage imageWithData:jpgData];
    self.imageView.image = image;
    
    self.messageLabel.text = date;
}

- (void)didReceiveMemoryWarning {
    [super didReceiveMemoryWarning];
    // Dispose of any resources that can be recreated.
}

